void GameSetup::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == whiteButton)
    {
        //[UserButtonCode_whiteButton] -- add your button handler code here..
        this->realPlayerColor = WHITE;
        //[/UserButtonCode_whiteButton]
    }
    else if (buttonThatWasClicked == blackButton)
    {
        //[UserButtonCode_blackButton] -- add your button handler code here..
        this->realPlayerColor = BLACK;
        //[/UserButtonCode_blackButton]
    }
    else if (buttonThatWasClicked == playButton)
    {
        //[UserButtonCode_playButton] -- add your button handler code here..
        if (this->gameListener != NULL) {
            this->gameListener->startGame();
        }
        //[/UserButtonCode_playButton]
    }
    else if (buttonThatWasClicked == vChess)
    {
        //[UserButtonCode_vChess] -- add your button handler code here..
        variant = CHESS;
        //[/UserButtonCode_vChess]
    }
    else if (buttonThatWasClicked == vRacingKings)
    {
        //[UserButtonCode_vRacingKings] -- add your button handler code here..
        variant = RACING_KINGS;
        //[/UserButtonCode_vRacingKings]
    }
    else if (buttonThatWasClicked == vAtomic)
    {
        //[UserButtonCode_vAtomic] -- add your button handler code here..
        variant = ATOMIC;
        //[/UserButtonCode_vAtomic]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}

